import './LeadSidebar.css'
import LeadOrgname from '../LeadOrgname/LeadOrgname'

function LeadSidebar({ orgids }) {
    return (
        <div className="leadsidebar-container">
            {orgids.map((orgid) => (
                <LeadOrgname key={orgid} id={orgid} />
            ))}
        </div>
    )
}

export default LeadSidebar
